import './App.css';
import First from './Components/First';
import Second from './Components/Second';




function App() {
  return (
    <div className="App">
   <img src = "https://drive.google.com/uc?export=view&amp;id=1mybd7v8aJf4HuL8Ph21fj6eBM8cBxMa9" className = "img" alt = ""  />


   <p className = "para">Illustration</p>
   <p className = "para1">24 lessons</p>
   <p className = "para2">134 min</p>
   <img className = "logo" src="data:image/svg+xml;base64," />    <img className = "btn" src = "https://www.flaticon.com/svg/vstatic/svg/890/890648.svg?token=exp=1613125242~hmac=6edf278fc256a0ec9fd00f1735a6a611" />
   <img className = "logo1" src = "data:image/svg+xml;base64," />  
   <img className = "logo2" src="data:image/svg+xml;base64," />
      <First />
      <Second />

    </div>
  );
}

export default App;
